import React from "react";

const ReadOnlyRow = ({contact }) => {
    return(
        <div>
            <tr>
                <td>{contact.id}</td>
                <td>{contact.firstName}</td>
                <td>{contact.lastName}</td>
                <td>{contact.email}</td>
                <td>{contact.phone}</td>
                <td>{contact.gender}</td>
            </tr>
        </div>
    )
}
